import React, { Component } from 'react';


class Nav extends Component {

    render() { 

        const navStyle = {
            display: 'flex',
            alignItems: 'center',
            minHeight: '10vh',
            backgroundColor: '#FFFFFFF',
            color: '#000000',
            borderBottom: '10px #000000 solid'
          }

        return(
            <nav style={navStyle}>
                <h3>Logo</h3>
                <ul className="nav-links">
                    <li>About</li>
                </ul>
            </nav>
        );
    }
}

export default Nav;
